var tipuesearch = {"pages": [{'title': 'About', 'text': '倉儲: https://github.com/40823245/cp2019 \n 小組倉儲: https://github.com/40823245/cp2019bg4 \xa0 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'works', 'text': '', 'tags': '', 'url': 'works.html'}, {'title': 'W4', 'text': '原始碼: \n void main() {\n  print("哈囉!");\n} \n hello程式 \n \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '\n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '原始碼: \n int i;\nint sum;\n \nmain(){\n  sum = 0;\n  for(i=1;i <=10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print("sum = $sum");\n} \n \n For loop程式 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '阻尼係數=1 \n \n 阻尼係數=0 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '\n \n  取 Dart 程式的按鈕  \n 放大   回復   Hello   For Loop   Sum   Runge-Kutta   Mass Spring Damping   ROC Flag   Grid   Slithery   Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W10-W13', 'text': '純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping   forCF \n Html 程式 \n ROC Flag   Grid   X-Y Plot   Slithery   CF random_grouping \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n \n \n \n \n 溫度轉換 \n temperatures   °C    °F:  \n \n', 'tags': '', 'url': 'W10-W13.html'}, {'title': 'JavaScript', 'text': '國旗 \n \n \n 亂數分組 \n 學員名單 URL:   每組人數:      \n \n', 'tags': '', 'url': 'JavaScript.html'}, {'title': 'W16 查驗考試', 'text': '\n', 'tags': '', 'url': 'W16 查驗考試.html'}, {'title': '星星講解', 'text': "\n 使用''canvas''、''2d''畫畫程式 \n \n drawStar(x座標，y座標，幾角星(5角星、8角星等等)，外半徑，內半徑) \n 外半徑(紅線) \n \n 內半徑(藍線) \n \n \xa0var rot = Math.pi / 2 * 3 \n pi=π \n 意思是2分之3 π=270° \n Ex1:45 ° \n \n \n Ex2:22.5 ° \n \n \n x抓cx值，y抓cy值，step計算方式=pi除以幾角 \n \n 預設''fff''為白色 \n moveTo移動到(x座標，y座標-外半徑) \n x=cx+cos(rot)*外半徑， x=cx+cos(rot)* 內半徑 \n y=cy+sin(rot)*外半徑，y=cy+sin(rot)*內半徑 \n lineTo畫線到(x座標，y座標) \n rot=rot+step \n \n 顏色設定 \n ctx.lineWidth=5 邊框厚度為5(此設定邊界和內部都為白色，所以看不出來) \n \xa0ctx.strokeStyle='white' 邊界為白色 \n ctx.fillStyle='white'內部為白色 \n 輸出範例 \n drawStar(10, 10, 10, 8, 4)\xa0 以此類推 \n", 'tags': '', 'url': '星星講解.html'}, {'title': '筆記', 'text': '', 'tags': '', 'url': '筆記.html'}]};